import React from 'react';

interface PercentCircleProps {
  title: string;
  percentage: number; // The percentage value to display (0 to 100)
  size: number; // The size of the circle in pixels
  strokeWidth: number; // The width of the circle's stroke in pixels
  circleColor: string; // The color of the circle's stroke
  textColor: string; // The color of the percentage text
}

const PercentCircle: React.FC<PercentCircleProps> = ({
  title,
  percentage,
  size,
  strokeWidth,
  circleColor,
  textColor,
}) => {
  // Calculate the radius of the circle
  const radius = (size - strokeWidth) / 2;

  // Calculate the circumference of the circle
  const circumference = 2 * Math.PI * radius;

  // Calculate the stroke dash offset to show the correct percentage
  const strokeDashoffset = circumference - (percentage / 100) * circumference;

  return (
    <svg width={size} height={size} viewBox={`0 0 ${size} ${size}`}>
      <circle
        cx={size / 2}
        cy={size / 2}
        r={radius}
        fill="transparent"
        stroke={circleColor}
        strokeWidth={strokeWidth}
        strokeDasharray={circumference}
        strokeDashoffset={strokeDashoffset}
      />
      <text>
        {title}
      </text>
      <text
        x="50%"
        y="50%"
        textAnchor="middle"
        fill={textColor}
        fontSize={size / 4}
        fontWeight="bold"
      >
        {percentage}%
      </text>
    </svg>
  );
};

export default PercentCircle;
